    "2014-10-28T20:55:04.136799",nt"name": "bathymetry-offshore-half-moon-bay-california",nt"isopen":
    false,nt"url": null,nt"notes": "This part of DS 781 presents data for the
    bathymetry and shaded-relief maps of the Offshore Half Moon Bay, California (raster
    data file is included in "Bathymetry_OffshoreHalfMoonBay.zip," which is accessible
    from http://pubs.usgs.gov/ds/781/OffshoreHalfMoonBay/data_catalog_OffshoreHalfMoonBay.html.
    The bathymetry and shaded-relief maps of Offshore Half Moon Bay, California, were
    generated from bathymetry data collected by Fugro Pelagos, and by California State
    University, Monterey Bay (CSUMB). Mapping was completed in 2006 and 2007, using
    a combination of 400-kHz Reson 7125 and 244-kHz Reson 8101 multibeam echosounders.
    These mapping missions combined to collect bathymetry from about the 10-m isobath
    to beyond the 3-nautical-mile limit of California's State Waters. NOTE: the horizontal
    datum of the bathymtry data (NAD83) differs from the horizontal datum of other layers
    in this SIM (WGS84). Some bathymetry grids within this map were projected horizontally
    from WGS84 to NAD83 using ESRI tools to be more consistent with the vertical reference
    of the North American Vertical Datum of 1988 (NAVD88). These data are not intended
    for navigational purposes.",nt"license_title": null,nt"extras": [{ntt"key":
